import React , {useEffect , useState} from 'react'
import Pagination from '@mui/material/Pagination'
import {Box , Stack , Typography }  from '@mui/material'
import ExerciceCard from './ExerciceCard'
const Exercices = (props) => {
    console.log(props.exercices)
    return (
        <Box id='exercices' mt='50px' p='15px'>
             {props.exercices.length > 0 && 
             (<Typography variant='h4'fontWeight='700' mb='50px' color='#131429'boxShadow='0px 5px 5px  gray'
             borderRadius={10}
             padding={2} sx={{textAlign:'center'}}>Results : </Typography>)}

            <Stack direction='row' sx={{gap : '50px'}} flexWrap='wrap' justifyContent='center'>
                {props.exercices.map((ex , index)=>{
                    return(
                        <ExerciceCard ex={ex} key={index}></ExerciceCard>
                    )
                })}
            </Stack>
            <Stack direction='row' justifyContent='center' mt='10px'>
               {props.exercices.length > 9 &&
                (<Pagination></Pagination>)
               }
            </Stack>
        </Box>
    )
}

export default Exercices
